import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ResumeVerification from './components/ResumeVerification';
import FloatingMenu from './components/FloatingMenu';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <FloatingMenu />
        <Routes>
          <Route path="/" element={<ResumeVerification />} />
          <Route path="/resume-verify" element={<ResumeVerification />} />
          <Route path="/resume-analytics" element={<ResumeVerification />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
